import React, { Component } from 'react'
import { NavLink } from 'react-router-dom'

const styleBar = {
  overflow: 'hidden',
  backgroundColor: 'black',
  float: 'left',
  display: 'block',
  color: '#f2f2f2',
  textAlign: 'center',
  padding: '14px 16px',
  fontSize: '17px'
}

const styleLink = {
  float: 'left',
  display: 'block',
  color: '#f2f2f2',
  textAlign: 'center',
  padding: '14px 16px',
  fontSize: '17px'
}


// ! Need to fix up logout
const Navbar = () => {
  return (
    <div className="navbar" style={styleBar}>
      <NavLink  to="/">Home</NavLink>
      <NavLink to="/leadlists">Dashboard</NavLink>
      <NavLink to="/profile">My Profile</NavLink>
      <NavLink to="/logout">Logout</NavLink>
    </div>
  );
};

export default Navbar;
